(1, NULL, '7934367', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_100/127902.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/127902.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/127902.JPG', 'url', 'AVERY-DENNISON', 'Avery Shipping Tags', 'Whether you&#39;re shipping items short or long distances, you want to ensure your shipping information stays put. These Shipping Tags offer a smooth writing surface with a neutral background that makes your text stand out for easy reading. Each tag features a reinforced hole for extra strength to hold the tag firmly without ripping through the cardstock. With these shipping tags, your shipping information stays secure, no matter how long the journey. Strung tags feature 12-inches of looped, #9 twine; double-wired tags feature 12-inches of 26-gauge wire (available unstrung, strung or wired).<hr>Whether you\'re shipping items short or long distances, you want to ensure your shipping information stays put. These Shipping Tags offer a smooth writing surface with a neutral background that makes your text stand out for easy reading. Each tag features a reinforced hole for extra strength to hold the tag firmly without ripping through the cardstock. With these shipping tags, your shipping information stays secure, no matter how long the journey. Strung tags feature 12-inches of looped, #9 twine; double-wired tags feature 12-inches of 26-gauge wire (available unstrung, strung or wired). Bright hue stands out, yet it\'s light enough to read. Unstrung. Size: 4 3/4 x 2 3/8; Color(s): Yellow; Material(s): 13 Point, 100% Chemical Wood Pulp Stock; Shape: Rectangle.', NULL, '12325', '3', '59', '271', '', '', 1, 97.00, 57.20, 'EA', '01', 55121503, 0, 0, 0, 'AVE12325.xml', 0, '2015-12-18 10:51:35', '2015-12-18 10:51:35', '', '', '', '', ''),
