(13, NULL, '8737116', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_100/203686.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/203686.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/203686.JPG', 'url', 'MASTER CASTER COMPANY', 'Master Caster Caster Puller Tool', 'A must have for on-the-spot caster replacement. This unique tool can remove, measure and install casters quickly and easily with no damage to casters, chairs or your hands. Pop out any grip ring stem caster with one quick snap, loosen or tighten threaded stem casters with a simple twist, and measure stem diameters of the most common sizes, even metric. Comes complete with a Selector Slide for caster wheel identification, simple instructions and a poly-vinyl carrying bag. Many new chairs are equipped with hard wheel casters for use on carpeted surfaces only. Hard wheels skate and slide on hard floor surfaces. For safe rolling on all hard floor surfaces, including chair mats, soft wheel casters should be used. Soft wheels provide traction and prevent skating, sliding and run-away chairs.<hr>A must have for on-the-spot caster replacement. This unique tool can remove, measure and install casters quickly and easily with no damage to casters, chairs or your hands. Pop out any grip ring stem caster with one quick snap, loosen or tighten threaded stem casters with a simple twist, and measure stem diameters of the most common sizes, even metric. Color: Gray Steel; Application: Casters; Material(s): Die Cast Steel; Overall Width: 3 3/4\".', NULL, '89900', '1', '90', '776', '', '', 1, 54.99, 59.95, 'EA', '01', 31162701, 0, 0, 0, 'MAS89900.xml', 0, '2015-12-18 10:51:35', '2015-12-18 10:51:35', '', '', '', '', ''),
