ize full-extension ball-bearing suspension and front facing lock to secure files. Color: Mocha Cherry; Overall Width: 30\"; Overall Depth: 23 1/8\"; Overall Height: 29 3/4\".', NULL, '2954MC-03', '1', '92', '761', '', '', 1, 359.99, 667.00, 'EA', '01', 56101702, 0, 0, 0, 'BSH2954MC03.xml', 0, '2015-12-18 10:51:35', '2015-12-18 10:51:35', '', '', '', '', ''),
