er. Manufactured to OEM specifications. This product was made from wood that came from a certified managed forest. Size: 3 1/8\" x 230 ft; Paper Color(s): White; Rolls Per Unit: 10; Machine Compatibility: Point of Sale Machines.', NULL, '07906', '3', '52', '321', '', '', 1, 24.99, 24.46, 'EA', '01', 14111515, 0, 0, 0, 'PMC07906.xml', 0, '2015-12-18 10:51:35', '2015-12-18 10:51:35', '', '', '', '', ''),
