(133, NULL, '6076525', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_100/76065.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/76065.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/76065.JPG', 'url', 'PILOT CORP. OF AMERICA', 'Pilot Better Retractable Ball Point Pen', 'High-quality stainless steel point provides smooth, dependable writing. Ribbed finger-grip ensures comfort and control. Tinted barrel shows visible ink supply. Classic styling and an excellent value. Retractable and refillable for continued use. Convenient metal pocket clip.<hr>High-quality stainless steel point provides smooth, dependable writing. Ribbed finger-grip ensures comfort and control. Tinted barrel shows visible ink supply. Classic styling and an excellent value. Retractable and refillable for continued use. Point Size: 1 mm; Point Type: Medium; Ink Color(s): Black; Pen Type: Ball Point.', NULL, '30005', '3', '62', '251', '', '', 1, 15.99, 25.20, 'EA', '01', 44121704, 0, 0, 0, 'PIL30005.xml', 0, '2015-12-18 10:51:35', '2015-12-18 10:51:35', '', '', '', '', ''),
