(441, NULL, '6109425', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_100/76835.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/76835.JPG', 'https://content.oppictures.com/Master_Images/Master_Variants/Variant_400/76835.JPG', 'url', 'PM COMPANY', 'PM Company Direct Thermal Printing Thermal Paper Rolls', 'PM is committed to a sustainable environment. In 2009, PM became the first forestry certified paper roll converter in the United States. The paper rolls are guaranteed to work efficiently with your machine printhead to provide crisp, clear, black images. The reliability and performance of a thermal printer is directly related to the quality of the supplies, including the paper, used by the customer. The IBM Testing Process is an Industry Standard test for the thermal papers used in the marketplace. To be IBM approved, the paper must pass a 100km of paper printhead test without abrasion or build-up, with no cutting failures. IBM testing only confirms that the use of approved papers will not negatively affect the operating life of an IBM thermal printer. Manufactured to OEM specifications. This product was made from wood that came from a certified managed forest.<hr>PM is committed to a sustainable environment. In 2009, PM became the first forestry certified paper roll converter in the United States. The paper rolls are guaranteed to work efficiently with your machine printhead to provide crisp, clear, black images. The reliability and performance of a thermal printer is directly related to the quality of the supplies, including the paper, used by the customer. The IBM Testing Process is an \"Industry Standard\" test for the thermal papers used in the marketplace. To be IBM approved, the paper must pass a 100km of paper printhead test without abrasion or build-up, with no cutting failures. IBM testing only confirms that the use of approved papers will not negatively affect the operating life of an IBM thermal printer. Manufactured to OEM specifications. This product was made from wood that came from a certified managed forest. Size: 2 1/4\" x 165 ft; Paper Color(s): White; Rolls Per Unit: 3; Machine Compatibility: Calculators.', NULL, '5247', '3', '52', '321', '', '', 1, 5.79, 6.10, 'EA', '01', 14111515, 0, 0, 0, 'PMC05247.xml', 0, '2015-12-18 10:51:36', '2015-12-18 10:51:36', '', '', '', '', '');
